import "/Menu.css";

function Menu() {
  const style1 = {
    fontSize: "250px",
    color: "blue",
    marginTop: "150px",
    fontWeight: "200px",
  };
  const style2 = {
    fontSize: "200px",
    color: "blue",
    fontWeight: "200px",
  };
  const style3 = {
    background: "lightblue",
    borderRadius: "25px",
    TextAlign: "center",
    fontSize: "45px",
    color: "white",
    display: "block",
    marginTop: "100px",
    width: "850px",
    height: "180px",
    fontSize: "120px",
  };
  const style4 = {
    background: "gray",
    /*border: 'solid 2px black',*/
    width: "100%",
    height: "180px",
    display: "block",
    TextAlign: "center",
    marginTop: "145px",
    fontSize: "120px",
  };
  return (
    <div className="App">
      <div style={style1}>안심</div>
      <div style={style2}>길찾기</div>
      <center>
        <botton style={style3}>길찾기</botton>
        <botton style={style3}>지난 경로</botton>
        <botton style={style3}>즐겨찾기경로</botton>
        <botton style={style4}>광고</botton>
      </center>
    </div>
  );
}

export default Menu;
